00236         public virtual Consumption ConsumeCharges(double amount)
00237         {
00238             if (amount == 0)
00239                 return Consumption.None;
00240 
00241             // Clamp incoming value to zero
00242             double unclamped = _charges - amount;
00243             var clamped = ((initialCharges >= 0) ? System.Math.Max(unclamped, 0) : System.Math.Min(unclamped, 0));
00244 
00245             _charges = clamped;
00246 
00247             if (/*useCharges && */clamped != initialCharges)
00248             {
00249                 return (clamped == 0) ? Consumption.All : Consumption.Partial;
00250             }
00251             return Consumption.None;
00252         }
00253 
00254         protected virtual void Consume(Consumption consumed)
00255         {
00256             if (consumed == Consumption.None)
00257                 return;
00258 
00259             // Despawn if we have consumed enough to trigger consumeDespawn
00260             if (consumeDespawn != Consumption.None && syncState != null)
00261             {
00262                 // If all was consumed, trigger despawn in both cases
00263                 if (consumed == Consumption.All)
00264                     syncState.Despawn(false);
00265 
00266                 // consumed == partial - despawn if consumeDespawn also is set to partial.
00267                 else if (consumeDespawn == Consumption.Partial)
00268                 {
00269                     syncState.Despawn(false);
00270                 }
00271             }
00272         }
