00371         public double DischargeValue(ContactType contactType = ContactType.Undefined)
00372         {
00373             double discharge;
00374 
00375             switch (contactType)
00376             {
00377                 case ContactType.Enter:
00378                     discharge = dischargeOnEnter;
00379                     break;
00380 
00381                 case ContactType.Stay:
00382                     discharge = dischargePerSec;
00383                     break;
00384 
00385                 case ContactType.Exit:
00386                     discharge = dischargeOnExit;
00387                     break;
00388 
00389                 case ContactType.Hitscan:
00390                     discharge = dischargeOnScan;
00391                     break;
00392 
00393                 default:
00394                     discharge = 0;
00395                     break;
00396             }
00397 
00398             if (useCharges)
00399             {
00400                 if (discharge >= 0)
00401                     return System.Math.Min(discharge, _charges);
00402                 else
00403                     return System.Math.Max(discharge, _charges);
00404             }
00405 
00406             return discharge;
00407         }
