00499 
00500             EditorGUI.BeginDisabledGroup(!nowEnabled);
00501             {
00502                 EditorGUI.LabelField(new Rect(r) { xMin = r.xMin + 20 + PAD, xMax = EditorGUIUtility.labelWidth }, label);
00503 
00504                 r.xMin += EditorGUIUtility.labelWidth;
00505 
00506                 if (nowEnabled)
00507                     EditorGUI.PropertyField(new Rect(r) { xMin = r.xMin - 2 }, sp, GUIContent.none);
00508             }
00509             EditorGUI.EndDisabledGroup();
00510 
00511             if (wasEnabled != nowEnabled)
00512             {
00513                 Undo.RecordObject(target, "Change " + label + " Toggle");
